('ASD12345678910111', 'BMW', '320d ', 'kombi', 2021, 5, 'Igen', 'Benzin', 'Elerheto', 'fekete', , ' ESTATE AUTOMATIC 7 illetve 8 fokozatú automata váltóval szerelve, a legújjabb sportos és egyben praktikus típusok állnak Ügyfeleink napi,- és tartós kölcsönzésére. Bérelje ki akár az ünnepi időszakra ezt a nagy csomagtérrel rendelkező családi prémium dízeles autót, megfizethető áron!', 'IS1234567');
INSERT INTO `jarmu` (`Alvazszam`, `Gyarto`, `Modell`, `Kivitel`, `GyartasiEv`, `Kapacitas`, `AutomataVáltó`, `Üzemanyag`, `Elerhetoseg`, `Szin`, `KepFeltoltes`, `Leiras`, `FelhasznaloID`) VALUES
('CHC12345678910111', 'Chevrolet', 'Impala', 'coupe', 1967, 4, 'Igen', 'Benzin', 'Elerheto', 'narancssárga', , 'Az Impala 1958-ban a Chevrolet Bel Air csúcsváltozataként indult, a kor szintjén némi sportos beütéssel – ekkoriban ez volt a legdrágább Chevy. \'65-ben aztán jött a Caprice, de az Impala még második legdrágább Chevyként is elég exkluzív maradt. A legismertebb talán az Impala második nemzedéke (1959–60), rengeteg jampifilmben tűnt fel jellegzetes, vízszintesbe hajló sirályszárnyaival.', 'GE1234567');
INSERT INTO `jarmu` (`Alvazszam`, `Gyarto`, `Modell`, `Kivitel`, `GyartasiEv`, `Kapacitas`, `AutomataVáltó`, `Üzemanyag`, `Elerhetoseg`, `Szin`, `KepFeltoltes`, `Leiras`, `FelhasznaloID`) VALUES
('DWS12345678910111', 'Toyota', 'C-HR ', 'terepjáró', 2017, 5, 'Igen', 'Benzin', 'Elerheto', 'fekete', , 'Toyota C-HR crossover városi szabadidő autó. Autóbérlés külföldre is lehetséges! Bérelje ki legújabb extravagáns dizájn autónkat a hosszú utazáshoz! A formabontó külső fantasztikus belső felszereltséget és komfortot takar, hogy élmény legyen a vezetés.', 'IS1234567');
INSERT INTO `jarmu` (`Alvazszam`, `Gyarto`, `Modell`, `Kivitel`, `GyartasiEv`, `Kapacitas`, `AutomataVáltó`, `Üzemanyag`, `Elerhetoseg`, `Szin`, `KepFeltoltes`, `Leiras`, `FelhasznaloID`) VALUES
('KLU12345678910111', 'Nissan', 'GTR', 'sport', 2022, 4, 'Igen', 'Benzin', 'Elerheto', 'fekete', , 'Nissan GT-R, becenevén Godzilla. Jelenleg az egyetlen keményvonalas japán sportkocsi a Honda NSX-en kívül, amely az európai szupersportkocsik teljesítményét nyújtja – ráadásul a Hondával ellentétben megfizethető áron. Egy álomautó, amely temérdek filmben szerepelt, amely megannyi kisfiú falán és férfi telefonján megjelenik, egy igazi szupersportautó, amely rengeteg rekordot állított be. Legenda.', 'BI1234567');
INSERT INTO `jarmu` (`Alvazszam`, `Gyarto`, `Modell`, `Kivitel`, `GyartasiEv`, `Kapacitas`, `AutomataVáltó`, `Üzemanyag`, `Elerhetoseg`, `Szin`, `KepFeltoltes`, `Leiras`, `FelhasznaloID`) VALUES
('NBT12345678910111', 'Opel', 'Grandland X', 'terepjáró', 2015, 5, 'Igen', 'Benzin', 'Nem Elerheto', 'kék', , 'Foglaljon helyet a legújabb Opel Grandland X-ben! A Grandland az Opel legnagyobb szabadidőautója, amely kellő helyet kínál akár egy hosszabb családi utazáshoz is. Ahol a stílus és a praktikum találkozik. Legújabb crossover autónkat az egész család imádni fogja.', 'AT1234567');
INSERT INTO `jarmu` (`Alvazszam`, `Gyarto`, `Modell`, `Kivitel`, `GyartasiEv`, `Kapacitas`, `AutomataVáltó`, `Üzemanyag`, `Elerhetoseg`, `Szin`, `KepFeltoltes`, `Leiras`, `FelhasznaloID`) VALUES
('SUP12345678910111', 'Toyota', 'Supra Mk4', 'sport', 2006, 2, 'Igen', 'Benzin', 'Elerheto', 'zöld', , 'Ha ki kellene választani a Toyota legjobb autóját, mindent figyelembe véve legtöbben kérdés nélkül a Suprát mondanák.De mégis mitől ilyen jó? Oké, hogy a Halálos Iramban lenyomják vele a Ferrarit, esetleg ezzel csúszod a legnagyobbat a Need for Speedben, de sokak szerint ez csak egy felkapott, túlértékelt átlagos japán sportkocsi. De nem, nem az, a Supra jogosan érdekelte ki a hírnevet.', 'SA1234567');
INSERT INTO `jarmu` (`Alvazszam`, `Gyarto`, `Modell`, `Kivitel`, `GyartasiEv`, `Kapacitas`, `AutomataVáltó`, `Üzemanyag`, `Elerhetoseg`, `Szin`, `KepFeltoltes`, `Leiras`, `FelhasznaloID`) VALUES
('TES12345678910111', 'Tesla', 'Modell 3', 'szedán', 2017, 4, 'Igen', 'Benzin', 'Elerheto', 'piros', , 'Elektromos Tesla Model 3 típusú luxusautó hosszútávon bérelhető a kínálatában. Tapasztalja meg a tisztán elektromos autózás teljesen egyedülálló élményét! Professzionális szaktanácsadás mellett nyitunk ki Önnek minden ajtót a Tesla világára. ', 'TE1234567');
INSERT INTO `jarmu` (`Alvazszam`, `Gyarto`, `Modell`, `Kivitel`, `GyartasiEv`, `Kapacitas`, `AutomataVáltó`, `Üzemanyag`, `Elerhetoseg`, `Szin`, `KepFeltoltes`, `Leiras`, `FelhasznaloID`) VALUES
('ZKR12345678910111', 'Fiat ', 'Doblo', 'kisteher', 2015, 3, 'Igen', 'Benzin', 'Elerheto', 'fehér', , 'Teherautó bérlés: kishaszonjárművek elérhetőek 2-20 m3 hasznos térfogattal, korlátlan belföldi és külföldi díjszabással egyaránt. a kisteherautók Többféle raktér méretben bérelhetőek. KISTEHERAUTÓ BÉRLÉS Budapest és környékén.', 'BI1234567');
INSERT INTO `jarmu` (`Alvazszam`, `Gyarto`, `Modell`, `Kivitel`, `GyartasiEv`, `Kapacitas`, `AutomataVáltó`, `Üzemanyag`, `Elerhetoseg`, `Szin`, `KepFeltoltes`, `Leiras`, `FelhasznaloID`) VALUES
('ZKV12345678910111', 'Ford', 'Tourneo', 'kisbusz', 2021, 9, 'Igen', 'Benzin', 'Nem Elerheto', 'kék', , 'Az új modell Ford Custom tdci 1 sofőr + 8 fős sokoldalú kisbusz üzleti és magáncélra is kitűnő választás, kényelmes, jól vezethető alacsony építésű univerzális személyszállító minivan. Jól variálható, kivehető ülésekkel, vagány megjelenésével minden útra megfelelő választás.', 'IS1234567');
INSERT INTO `jarmu` (`Alvazszam`, `Gyarto`, `Modell`, `Kivitel`, `GyartasiEv`, `Kapacitas`, `AutomataVáltó`, `Üzemanyag`, `Elerhetoseg`, `Szin`, `KepFeltoltes`, `Leiras`, `FelhasznaloID`) VALUES
('ZZQ12345678910111', 'Volkswagen', ' Golf 7', 'kombi', 2015, 5, 'Igen', 'Benzin', 'Nem Elerheto', 'szürke', , 'A Volkswagen Golf 7 bérautó nem véletlenül a kompakt kategória csúcsautója: Ötajtós kialakítás, takarékos Bluemotion turbódízel motor, dupla kuplungos váltó, modern vezetősegítő megoldások, tágas belső, mesteri kidolgozottságú utastér, prémium anyaghasználat és remek csomagtartó helykínálat jellemzi. A Volkswagen Golf 7 kölcsönautó minden, amire egy minőségi bérautót kereső csak vágyhat. Bérelhető Budapesten akár hosszútávra, egyéni vagy céges használatra!', 'AT1234567');

